              // Aboutus
    {
          'odzj4xxa': {'en': 'Welcome to UMEED','gu': '','mr': '',},'ccaiarce': {'en': 'At UMEED, we believe in the power of compassion and the positive impact that small acts of kindness can have on the world. Our platform is not just an app; it\'s a community-driven initiative dedicated to making a difference in the lives of those in need.','gu': '','mr': '',},'avulmyod': {'en': 'Our Mission','gu': '','mr': '',},'kzj568so': {'en': 'Empowering Change Through Giving','gu': '','mr': '',},'ggjbapg2': {'en': 'Our mission is to create a world where everyone has access to basic necessities, a warm meal, and the comfort of knowing that someone cares. We strive to bridge the gap between those who have resources to spare and those who are in desperate need.','gu': '','mr': '',},'izlvjy69': {'en': 'What We Do','gu': '','mr': '',},'lp09183c': {'en': 'Clothing Donations','gu': '','mr': '',},'m4oyoycm': {'en': 'With UMEED , you can easily donate gently used clothes to individuals and families facing challenging circumstances. Your old clothes can become a source of warmth and dignity for someone in need.','gu': '','mr': '',},'nlg4bv0h': {'en': 'Fundraising for Causes','gu': '','mr': '',},'n58h5atj': {'en': 'We provide a platform for individuals and organizations to raise funds for causes close to their hearts. Whether it\'s a local community project or a global humanitarian effort, we facilitate the power of collective giving.','gu': '','mr': '',},'9nim6gk0': {'en': 'Food Drives','gu': '','mr': '',},'h1tz8f30': {'en': 'Hunger is an unfortunate reality for many. Through our app, you can contribute to food drives and make sure that no one goes to bed hungry. Every small donation adds up to make a significant impact.','gu': '','mr': '',},'i07nolfh': {'en': 'Animal Care Initiatives','gu': '','mr': '',},'f8tqggrw': {'en': 'UMEED is committed to animal welfare. Contribute to causes that support shelters, veterinary care, and adoption programs. Help create a world where every animal receives the love and care they deserve.','gu': '','mr': '',},'izqi4rgy': {'en': 'Environmental Conservation','gu': '','mr': '',},'y39oz3l0': {'en': 'Join us in our efforts to protect and preserve the environment. Support initiatives that focus on reforestation, waste reduction, and sustainable practices. Together, we can work towards a greener and healthier planet.','gu': '','mr': '',},'8woc059p': {'en': 'How It Works','gu': '','mr': '',},'1q0gcsq5': {'en': '1) Download the App: Get started by downloading UMMED with the help of our apk.\n\n2) Choose Your Cause: Browse through various causes, including clothing drives, fundraisers, food donation campaigns, animal care, and environmental conservation.\n\n3) Donate: With just a few taps, you can contribute to the cause that resonates with you. Whether it\'s clothes, funds, food, or support for animals and the environment, your generosity matters.\n\n4) Spread the Word: Share your donation journey on social media and inspire others to join the movement.','gu': '','mr': '',},'sfxviw4s': {'en': 'Join Us in Making a Difference','gu': '','mr': '',},'h7prpkq0': {'en': 'UMMED is not just a platform; it\'s a movement fueled by the generosity of individuals like you. Together, we can create a world where compassion knows no boundaries, animals are cherished, and the environment thrives.','gu': '','mr': '',},'lrsgxt1t': {'en': 'Contact Us','gu': '','mr': '',},'77tbrbmq': {'en': 'Have questions or suggestions? We\'d love to hear from you. Contact our team at [contactUmeed@email.com] or reach out through our social media channels.\n\nThank you for being a part of UMEED and for making the world a better place, one donation at a time.','gu': '','mr': '',},'h7tto9xo': {'en': 'Home','gu': '','mr': '',},
